import { useSelector } from "react-redux";

const Page1 = () => {
  const counter = useSelector((state) => state.counter);

  const clickHandler = () => {};

  return (
    <div>
      <div>Hey, You are in page 1. Counter is {counter}</div>
      <button onClick={clickHandler}>Click Me</button>
    </div>
  );
};

export default Page1;
